// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

contract Enum {
    enum Status {
        None,
        Pending,
        Shipping,
        Completed,
        Canceled
    }

    Status public status;

    struct Order {
        address buyer;
        Status status;
    }

    Order[] public order;


}

